import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
 [ 
<h1>Pawan Technical react APP</h1>,
<p>Here are the list of my fav NetFlix Series</p>,
<ol>
  <li>Dark</li>
  <li>Money Hiest</li>
  <li>Prison Break</li>
  <li>Mr. Robot</li>
  <li>My Holo Love</li>
</ol>
 ],
document.getElementById("root")
);
